import styles from "./ToolBar.module.scss";
import ToolBarOption from "../ToolBarOption/ToolBarOption";
//
import VisibilityIcon from "@mui/icons-material/Visibility";
import FilterAltIcon from "@mui/icons-material/FilterAlt";
import AppsIcon from "@mui/icons-material/Apps";
import RssFeedIcon from "@mui/icons-material/RssFeed";
import SyncIcon from "@mui/icons-material/Sync";
import SwitchLeftIcon from "@mui/icons-material/SwitchLeft";
//
const ToolBar = () => {
	return (
		<div className={styles.toolBar}>
			<div className={styles.left}>
				<ToolBarOption text="Update" icon={<SyncIcon fontSize="large" />} />
				<ToolBarOption
					text="RSS Sync"
					icon={<RssFeedIcon fontSize="medium" />}
				/>
			</div>
			<div className={styles.right}>
				<ToolBarOption text="Options" icon={<AppsIcon fontSize="large" />} />
				<div className={styles.seperator}></div>
				<ToolBarOption
					text="View"
					icon={<VisibilityIcon fontSize="medium" />}
				/>
				<ToolBarOption
					text="Filter"
					icon={<SwitchLeftIcon fontSize="medium" />}
				/>
				<ToolBarOption
					text="Filter"
					icon={<FilterAltIcon fontSize="medium" />}
				/>
			</div>
		</div>
	);
};
export default ToolBar;
